import { Children } from "react"
import { useNavigate } from "react-router-dom"

function privateRoute({isLoggedIn}){
     const navigate = useNavigate;
      if(isLoggedIn){
        return Children
      }
      else{
        return navigate("/login")
      }
}

export default privateRoute
